import React from 'react';
import './App.css';

class App extends React.Component {
  state = {
    chapter_state: {
      page_index: 1
    },
    manga_chapter: {
      title: "World Trigger",
      chapter_num: 59,
      pages: {
        1: {
          img: "https://i998.mangareader.net/world-trigger/186/world-trigger-13026805.jpg"
        },
        2: {
          img: "https://i996.mangareader.net/world-trigger/186/world-trigger-13026793.jpg"

        },
        3: {
          img: "https://i996.mangareader.net/world-trigger/186/world-trigger-13026793.jpg"
        }
      }
    }
  }

  constructor(props) {
    super(props);

    state["chapter_state"] = {
      page_index: 1
    }
    console.log("hello world");
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h2>
            { this.state.manga_chapter.title }
          </h2>
          <img src="https://i998.mangareader.net/world-trigger/186/world-trigger-13026805.jpg"></img>
        </header>
      </div>
    )
  }
}

export default App;
